(window.webpackJsonp=window.webpackJsonp||[]).push([[163],{791:function(n,e){n.exports="\x3c!--\ntitle: 05-CubeIDE入门\nsort:\n--\x3e\n\n> 图形化开发\n\n## 点灯\n\n1. 进入`.ioc`文件，图形化配置引脚：`PC13->GPIO_Output`\n2. 进入`SYS`菜单，配置烧录模式：\n   ![配置烧录模式](https://img-1257284600.cos.ap-beijing.myqcloud.com/2021/image-20210314144921580.png)\n3. `Ctrl+S`保存，自动生成代码。\n4. 在 while 循环中插入如下代码：\n\n```c\nwhile (1)\n{\n  /* USER CODE END WHILE */\n  HAL_Delay(500);\n  HAL_GPIO_TogglePin(GPIOC, GPIO_PIN_13);\n  /* USER CODE BEGIN 3 */\n}\n```\n\n## 问题\n\n### 无法连接设备\n\n> 首先将 boot0 短接至 3.3\n>\n> 设置 sys 的 Debug 模式\n\n![image-20210314144921580](C:\\Users\\44153\\AppData\\Roaming\\Typora\\typora-user-images\\image-20210314144921580.png)\n"}}]);